const express = require('express');
const cors = require('cors');

const app = express();
const port = 8080;

app.use(cors());

app.get('/blueprints/:author', (req, res) => {
  const author = req.params.author;
  // Lógica para obtener planos
  res.json([{ name: 'Plano 1', points: 5 }, { name: 'Plano 2', points: 10 }]);
});

app.listen(port, () => {
  console.log(`Servidor corriendo en http://localhost:${port}`);
});
